package week1.day2;

public class LearnSwitchcase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
String browser="null";
switch (browser) {

case "safari":System.out.println("Safari browser launched sucessfully");break;
case "Chrome":System.out.println("Chrome browser launched sucessfully");break;
case "IE":System.out.println("IE browser launched sucessfully");break;
case "firefox":System.out.println("Firefox browser launched sucessfully");break;
default:
	System.out.println("Edge browser launched sucessfully");break;
	
}
	}

}
